        </div> */}

          <div className="col-md-6 about-right">
            <img src={about1} className="img-fluid w-50" alt="about" />
            <img src={about2} className="img-fluid w-50 img2" alt="about" />
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default AboutContent;
